import React, { useState } from 'react';

const ParthGuider = () => {
  const [selectedSlot, setSelectedSlot] = useState(null);
  const [allPaths, setAllPaths] = useState([]);
  const [bestPath, setBestPath] = useState(null);

  // Mock parking lot layout (10x8 grid)
  const parkingLot = Array(8).fill().map((_, row) => 
    Array(10).fill().map((_, col) => ({
      id: `${row}-${col}`,
      x: col,
      y: row,
      isSlot: Math.random() > 0.3,
      isOccupied: Math.random() > 0.7,
      isEntrance: row === 7 && col === 0
    }))
  );

  // Predefined paths with hardcoded routes and metrics
  const predefinedPaths = {
    // Different path templates based on target location
    'top-left': [
      {
        id: 1,
        name: "Direct Route",
        distance: 85,
        tJunctions: 2,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 1, y: 6 },
          { x: 2, y: 5 },
          { x: 3, y: 4 }
        ]
      },
      {
        id: 2,
        name: "Main Lane",
        distance: 120,
        tJunctions: 4,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 3, y: 7 },
          { x: 6, y: 7 },
          { x: 6, y: 4 },
          { x: 3, y: 4 }
        ]
      },
      {
        id: 3,
        name: "Perimeter Route",
        distance: 145,
        tJunctions: 6,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 0, y: 5 },
          { x: 0, y: 3 },
          { x: 1, y: 3 },
          { x: 2, y: 3 },
          { x: 3, y: 4 }
        ]
      }
    ],
    'top-right': [
      {
        id: 1,
        name: "Express Route",
        distance: 95,
        tJunctions: 3,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 4, y: 7 },
          { x: 7, y: 4 },
          { x: 8, y: 2 }
        ]
      },
      {
        id: 2,
        name: "Central Path",
        distance: 110,
        tJunctions: 4,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 2, y: 7 },
          { x: 5, y: 6 },
          { x: 7, y: 4 },
          { x: 8, y: 2 }
        ]
      },
      {
        id: 3,
        name: "Scenic Route",
        distance: 155,
        tJunctions: 7,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 3, y: 7 },
          { x: 6, y: 7 },
          { x: 9, y: 6 },
          { x: 9, y: 4 },
          { x: 8, y: 2 }
        ]
      },
      {
        id: 4,
        name: "Back Route",
        distance: 180,
        tJunctions: 8,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 0, y: 5 },
          { x: 2, y: 3 },
          { x: 5, y: 1 },
          { x: 8, y: 2 }
        ]
      }
    ],
    'middle': [
      {
        id: 1,
        name: "Straight Shot",
        distance: 75,
        tJunctions: 1,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 2, y: 6 },
          { x: 4, y: 5 }
        ]
      },
      {
        id: 2,
        name: "Side Route",
        distance: 100,
        tJunctions: 3,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 1, y: 7 },
          { x: 3, y: 6 },
          { x: 4, y: 5 }
        ]
      },
      {
        id: 3,
        name: "Loop Path",
        distance: 130,
        tJunctions: 5,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 3, y: 7 },
          { x: 6, y: 6 },
          { x: 5, y: 4 },
          { x: 4, y: 5 }
        ]
      }
    ],
    'bottom': [
      {
        id: 1,
        name: "Quick Path",
        distance: 65,
        tJunctions: 2,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 3, y: 7 },
          { x: 5, y: 6 }
        ]
      },
      {
        id: 2,
        name: "Main Corridor",
        distance: 90,
        tJunctions: 3,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 2, y: 7 },
          { x: 4, y: 7 },
          { x: 5, y: 6 }
        ]
      },
      {
        id: 3,
        name: "Alternative Route",
        distance: 115,
        tJunctions: 4,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 1, y: 6 },
          { x: 3, y: 5 },
          { x: 5, y: 6 }
        ]
      },
      {
        id: 4,
        name: "Wide Turn",
        distance: 140,
        tJunctions: 6,
        coordinates: [
          { x: 0, y: 7 }, // Entrance
          { x: 4, y: 7 },
          { x: 7, y: 7 },
          { x: 8, y: 6 },
          { x: 6, y: 5 },
          { x: 5, y: 6 }
        ]
      }
    ]
  };

  const generatePaths = (targetSlot) => {
    if (!targetSlot) return [];

    // Determine which path set to use based on target location
    let pathTemplate = 'middle';
    if (targetSlot.x <= 3 && targetSlot.y <= 3) pathTemplate = 'top-left';
    else if (targetSlot.x >= 6 && targetSlot.y <= 3) pathTemplate = 'top-right';
    else if (targetSlot.y >= 6) pathTemplate = 'bottom';

    const templatePaths = predefinedPaths[pathTemplate];
    
    // Create paths with target slot as final destination and random traffic
    const paths = templatePaths.map(template => ({
      ...template,
      trafficIntensity: Math.floor(Math.random() * 80) + 20, // 20-100%
      coordinates: [...template.coordinates.slice(0, -1), targetSlot], // Replace last coordinate with actual target
      score: calculatePathScore(template.distance, template.tJunctions, Math.floor(Math.random() * 80) + 20)
    }));

    return paths.sort((a, b) => a.score - b.score);
  };



  const calculatePathScore = (distance, tJunctions, trafficIntensity) => {
    // Lower score is better
    return (distance * 0.4) + (tJunctions * 15) + (trafficIntensity * 0.8);
  };

  const handleSlotClick = (slot) => {
    if (slot.isSlot && !slot.isOccupied && !slot.isEntrance) {
      setSelectedSlot(slot);
      const paths = generatePaths(slot);
      setAllPaths(paths);
      setBestPath(paths[0]);
    }
  };

  const getSlotColor = (slot) => {
    if (slot.isEntrance) return '#10b981'; // green-500
    if (!slot.isSlot) return '#1f2937'; // gray-800
    if (slot.isOccupied) return '#ef4444'; // red-500
    if (selectedSlot && slot.id === selectedSlot.id) return '#fbbf24'; // yellow-400
    return '#60a5fa'; // blue-400
  };

  const getPathColor = (pathId, isBest) => {
    if (isBest) return '#00ff88';
    const colors = ['#ff6b6b', '#4ecdc4', '#45b7d1', '#96ceb4', '#ffeaa7'];
    return colors[pathId % colors.length];
  };

  const getIntensityColor = (intensity) => {
    if (intensity < 30) return '#4ade80'; // green-400
    if (intensity < 70) return '#facc15'; // yellow-400
    return '#f87171'; // red-400
  };

  const containerStyle = {
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #581c87 0%, #1e3a8a 50%, #312e81 100%)',
    padding: '24px',
    fontFamily: 'system-ui, -apple-system, sans-serif'
  };

  const mainContainerStyle = {
    maxWidth: '1280px',
    margin: '0 auto'
  };

  const headerStyle = {
    textAlign: 'center',
    marginBottom: '32px'
  };

  const titleStyle = {
    fontSize: '2.25rem',
    fontWeight: 'bold',
    color: 'white',
    marginBottom: '8px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    gap: '12px'
  };

  const subtitleStyle = {
    color: '#a5f3fc',
    fontSize: '1.125rem'
  };

  const gridStyle = {
    display: 'grid',
    gridTemplateColumns: '2fr 1fr',
    gap: '32px'
  };

  const cardStyle = {
    background: 'rgba(0, 0, 0, 0.3)',
    backdropFilter: 'blur(16px)',
    borderRadius: '16px',
    padding: '24px',
    border: '1px solid rgba(34, 211, 238, 0.2)'
  };

  const cardTitleStyle = {
    fontSize: '1.5rem',
    fontWeight: 'bold',
    color: 'white',
    marginBottom: '16px',
    display: 'flex',
    alignItems: 'center',
    gap: '8px'
  };

  const parkingGridContainerStyle = {
    position: 'relative',
    background: '#111827',
    borderRadius: '12px',
    padding: '16px',
    overflow: 'hidden'
  };

  const parkingGridStyle = {
    display: 'grid',
    gridTemplateColumns: 'repeat(10, 1fr)',
    gap: '4px',
    marginBottom: '16px'
  };

  const slotStyle = (slot) => ({
    width: '32px',
    height: '32px',
    borderRadius: '4px',
    cursor: slot.isSlot && !slot.isOccupied && !slot.isEntrance ? 'pointer' : 'default',
    transition: 'all 0.3s ease',
    transform: 'scale(1)',
    backgroundColor: getSlotColor(slot),
    border: 'none',
    display: 'block'
  });

  const legendStyle = {
    marginTop: '16px',
    display: 'flex',
    flexWrap: 'wrap',
    gap: '16px',
    fontSize: '0.875rem'
  };

  const legendItemStyle = {
    display: 'flex',
    alignItems: 'center',
    gap: '8px'
  };

  const legendColorStyle = (color) => ({
    width: '16px',
    height: '16px',
    backgroundColor: color,
    borderRadius: '4px'
  });

  const bestPathCardStyle = {
    background: 'linear-gradient(90deg, rgba(34, 197, 94, 0.2) 0%, rgba(6, 182, 212, 0.2) 100%)',
    backdropFilter: 'blur(16px)',
    borderRadius: '16px',
    padding: '24px',
    border: '1px solid rgba(34, 197, 94, 0.3)',
    marginBottom: '24px'
  };

  const metricRowStyle = {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: '12px'
  };

  const pathListStyle = {
    maxHeight: '384px',
    overflowY: 'auto'
  };

  const pathItemStyle = (isBest) => ({
    padding: '16px',
    borderRadius: '12px',
    border: isBest ? '1px solid #22c55e' : '1px solid #4b5563',
    background: isBest ? 'rgba(34, 197, 94, 0.2)' : 'rgba(31, 41, 55, 0.5)',
    marginBottom: '12px',
    cursor: 'pointer',
    transition: 'all 0.3s ease'
  });

  const pathMetricsGridStyle = {
    display: 'grid',
    gridTemplateColumns: '1fr 1fr',
    gap: '8px',
    fontSize: '0.875rem'
  };

  const instructionsCardStyle = {
    background: 'rgba(59, 130, 246, 0.2)',
    backdropFilter: 'blur(16px)',
    borderRadius: '16px',
    padding: '24px',
    border: '1px solid rgba(59, 130, 246, 0.3)'
  };

  return (
    <div style={containerStyle}>
      <div style={mainContainerStyle}>
        {/* Header */}
        <div style={headerStyle}>
          <h1 style={titleStyle}>
            <span style={{color: '#22d3ee'}}>🧭</span>
            Smart Parking Pathfinder
            <span style={{color: '#4ade80'}}>🚗</span>
          </h1>
          <p style={subtitleStyle}>Find the optimal path to your parking slot</p>
        </div>

        <div style={gridStyle}>
          {/* Parking Lot Visualization */}
          <div>
            <div style={cardStyle}>
              <h2 style={cardTitleStyle}>
                <span style={{color: '#22d3ee'}}>📍</span>
                Parking Lot Layout
              </h2>
              
              <div style={parkingGridContainerStyle}>
                {/* Grid */}
                <div style={parkingGridStyle}>
                  {parkingLot.flat().map((slot) => (
                    <button
                      key={slot.id}
                      style={slotStyle(slot)}
                      onClick={() => handleSlotClick(slot)}
                      title={
                        slot.isEntrance ? 'Entrance' :
                        !slot.isSlot ? 'Wall' :
                        slot.isOccupied ? 'Occupied' :
                        'Available Slot'
                      }
                      onMouseEnter={(e) => {
                        if (slot.isSlot && !slot.isOccupied && !slot.isEntrance) {
                          e.target.style.transform = 'scale(1.1)';
                          e.target.style.boxShadow = '0 0 20px rgba(34, 211, 238, 0.5)';
                        }
                      }}
                      onMouseLeave={(e) => {
                        e.target.style.transform = 'scale(1)';
                        e.target.style.boxShadow = 'none';
                      }}
                    />
                  ))}
                </div>

                {/* Path Visualization */}
                <svg style={{
                  position: 'absolute',
                  top: 0,
                  left: 0,
                  width: '100%',
                  height: '100%',
                  pointerEvents: 'none'
                }}>
                  {allPaths.map((path) => (
                    <path
                      key={path.id}
                      d={`M ${path.coordinates.map(coord => `${coord.x * 36 + 32} ${coord.y * 36 + 32}`).join(' L ')}`}
                      stroke={getPathColor(path.id, path.id === bestPath?.id)}
                      strokeWidth={path.id === bestPath?.id ? "4" : "2"}
                      fill="none"
                      strokeDasharray={path.id === bestPath?.id ? "0" : "5,5"}
                      opacity={path.id === bestPath?.id ? "1" : "0.6"}
                      style={{
                        animation: 'pulse 2s infinite'
                      }}
                    />
                  ))}
                </svg>

                {/* Legend */}
                <div style={legendStyle}>
                  <div style={legendItemStyle}>
                    <div style={legendColorStyle('#10b981')}></div>
                    <span style={{color: 'white'}}>Entrance</span>
                  </div>
                  <div style={legendItemStyle}>
                    <div style={legendColorStyle('#60a5fa')}></div>
                    <span style={{color: 'white'}}>Available</span>
                  </div>
                  <div style={legendItemStyle}>
                    <div style={legendColorStyle('#ef4444')}></div>
                    <span style={{color: 'white'}}>Occupied</span>
                  </div>
                  <div style={legendItemStyle}>
                    <div style={legendColorStyle('#fbbf24')}></div>
                    <span style={{color: 'white'}}>Selected</span>
                  </div>
                  <div style={legendItemStyle}>
                    <div style={legendColorStyle('#1f2937')}></div>
                    <span style={{color: 'white'}}>Wall</span>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* Path Analysis Panel */}
          <div>
            {/* Best Path Card */}
            {bestPath && (
              <div style={bestPathCardStyle}>
                <h3 style={{...cardTitleStyle, fontSize: '1.25rem'}}>
                  <span style={{color: '#4ade80'}}>⚡</span>
                  Optimal Path
                </h3>
                <div>
                  <div style={metricRowStyle}>
                    <span style={{color: '#86efac'}}>Distance:</span>
                    <span style={{color: 'white', fontWeight: 'bold'}}>{bestPath.distance}m</span>
                  </div>
                  <div style={metricRowStyle}>
                    <span style={{color: '#86efac'}}>T-Junctions:</span>
                    <span style={{color: 'white', fontWeight: 'bold'}}>{bestPath.tJunctions}</span>
                  </div>
                  <div style={metricRowStyle}>
                    <span style={{color: '#86efac'}}>Traffic:</span>
                    <span style={{color: getIntensityColor(bestPath.trafficIntensity), fontWeight: 'bold'}}>
                      {bestPath.trafficIntensity}%
                    </span>
                  </div>
                  <div style={{
                    ...metricRowStyle,
                    paddingTop: '8px',
                    borderTop: '1px solid rgba(34, 197, 94, 0.3)'
                  }}>
                    <span style={{color: '#86efac'}}>Score:</span>
                    <span style={{color: '#4ade80', fontWeight: 'bold'}}>{bestPath.score.toFixed(1)}</span>
                  </div>
                </div>
              </div>
            )}

            {/* All Paths List */}
            <div style={cardStyle}>
              <h3 style={cardTitleStyle}>
                <span style={{color: '#22d3ee'}}>🛣️</span>
                All Possible Paths
              </h3>
              
              {allPaths.length === 0 ? (
                <div style={{textAlign: 'center', padding: '32px 0'}}>
                  <div style={{fontSize: '3rem', marginBottom: '12px'}}>🚗</div>
                  <p style={{color: '#9ca3af'}}>Select a parking slot to see available paths</p>
                </div>
              ) : (
                <div style={pathListStyle}>
                  {allPaths.map((path) => (
                    <div
                      key={path.id}
                      style={pathItemStyle(path.id === bestPath?.id)}
                      onMouseEnter={(e) => {
                        if (path.id !== bestPath?.id) {
                          e.target.style.borderColor = '#22d3ee';
                        }
                      }}
                      onMouseLeave={(e) => {
                        if (path.id !== bestPath?.id) {
                          e.target.style.borderColor = '#4b5563';
                        }
                      }}
                    >
                      <div style={{
                        display: 'flex',
                        justifyContent: 'space-between',
                        alignItems: 'center',
                        marginBottom: '8px'
                      }}>
                        <span style={{color: 'white', fontWeight: 'bold'}}>Path {path.id}</span>
                        {path.id === bestPath?.id && (
                          <span style={{color: '#4ade80', fontSize: '0.875rem', fontWeight: 'bold'}}>BEST</span>
                        )}
                      </div>
                      <div style={pathMetricsGridStyle}>
                        <div style={{display: 'flex', alignItems: 'center', gap: '4px'}}>
                          <span style={{color: '#22d3ee'}}>⏱️</span>
                          <span style={{color: '#d1d5db'}}>{path.distance}m</span>
                        </div>
                        <div style={{display: 'flex', alignItems: 'center', gap: '4px'}}>
                          <span style={{color: '#facc15'}}>⚠️</span>
                          <span style={{color: '#d1d5db'}}>{path.tJunctions} T-J</span>
                        </div>
                        <div style={{display: 'flex', alignItems: 'center', gap: '4px'}}>
                          <span style={{color: getIntensityColor(path.trafficIntensity)}}>🚦</span>
                          <span style={{color: getIntensityColor(path.trafficIntensity)}}>
                            {path.trafficIntensity}%
                          </span>
                        </div>
                        <div style={{textAlign: 'right'}}>
                          <span style={{fontSize: '0.75rem', color: '#9ca3af'}}>Score: </span>
                          <span style={{color: 'white', fontWeight: 'bold'}}>{path.score.toFixed(1)}</span>
                        </div>
                      </div>
                      <div style={{
                        fontSize: '0.75rem',
                        color: '#a3a3a3',
                        marginTop: '8px',
                        fontStyle: 'italic'
                      }}>
                        {path.name}
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>

            {/* Instructions */}
            <div style={{...instructionsCardStyle, marginTop: '24px'}}>
              <h3 style={{...cardTitleStyle, fontSize: '1.125rem', marginBottom: '12px'}}>How to Use</h3>
              <ul style={{color: '#bfdbfe', fontSize: '0.875rem', listStyle: 'none', padding: 0}}>
                <li style={{marginBottom: '8px'}}>• Click on any available (blue) parking slot</li>
                <li style={{marginBottom: '8px'}}>• View all possible paths with their metrics</li>
                <li style={{marginBottom: '8px'}}>• The optimal path is highlighted in green</li>
                <li>• Lower scores indicate better paths</li>
              </ul>
            </div>
          </div>
        </div>
      </div>

      <style>{`
        @keyframes pulse {
          0%, 100% { opacity: 1; }
          50% { opacity: 0.5; }
        }
      `}</style>
    </div>
  );
};

export default ParthGuider;
